import React from 'react'

import { ButtonWrap } from '@mui/material';

const Button = ( { text, color, width, fontSize, backgroundColor, } ) => {
  return (
    <ButtonWrap 
      color={ color } 
      width={ width }
      fontSize={ fontSize }
      backgroundColor={ backgroundColor }
    >
      { text }
    </ButtonWrap>
  )
}

export default Button;
